import React from 'react';
import './OvalIcons.css';
import ovalImage from '../assets/industry-oval.png'; // Replace with the path to your oval image
import buyIcon from '../assets/industry-buy.png'; // Replace with the path to your buy icon
import sellIcon from '../assets/industry-sell.png'; // Replace with the path to your sell icon
import printIcon from '../assets/industry-list.png'; // Replace with the path to your print icon

function OvalIcons() {
  return (
    <div className="oval-icons-container">
      <img src={ovalImage} alt="Oval Background" className="oval-background" />
      <div className="icons">
        <img src={buyIcon} alt="Buy" className="icon" />
        <img src={printIcon} alt="Print" className="icon" />
        <img src={sellIcon} alt="Sell" className="icon" />
      </div>
    </div>
  );
}

export default OvalIcons;
